import React, { Component } from "react";
import { FaAlignRight } from 'react-icons/fa';
import "./Navbar.css";

export default class Navbar extends Component {
  state = {
    toggle: false
  }
  Toggle = () => {
    this.setState({toggle: !this.state.toggle})
  }
  render() {
    return (
      <>
        <header className="Navbar">
          <div className="Toolbar">
            <div className="Title">BECOMING<br/>BUSINESSWOMEN</div>
            <div className="Toolbar">
              <button onClick = {this.Toggle}>
                <FaAlignRight />
              </button>
              <ul className = {this.state.toggle ? "navbar--link show-nav" : "navbar--links"}>
                <li href = "#">HOME</li>
                <li href = "#">OUR TEAM</li>
                <li href = "#">JOIN US!</li>
                <li href = "#">CONTACT</li>
              </ul>
            </div>
          </div>
        </header>
        <div className="Toolbar"/>
      </>  
    );
  }
}
